function MD5(object) {
  let that = sign.sign.split("|")[86]
  if (typeof object == "object") {
    let arr = []
    for (const key in object) {
      if (object.hasOwnProperty(key)) {
        arr.push(`${key}=${object[key]}`)
      }
    }
    arr.sort()

    let str = arr.join("&")
    str = str + `&${that}`
    md5(str)
    return md5(str)
  } else {
    let query = object.split("?")[1]
    let arr = query.split("&")
    let obj = {}

    arr.forEach((item) => {
      obj[item.split("=")[0]] = item.split("=")[1]
    })

    let _arr = []
    for (const key in obj) {
      _arr.push(`${key}=${obj[key]}`)
    }
    _arr.sort()

    let str = _arr.join("&")
    if (str.indexOf("url=") !== -1) {
      str = str.split("url=")[1]
      str = decodeURIComponent(str)
      str = "url=" + str
    }
    str = str + `&${that}`
    md5(str)
    return md5(str)
  }
}
